def search_page():
    st.title("**Search for Matching Entries**")
    
    # User input fields
    student_name = st.text_input("Enter your name:")
    school = st.text_input("Enter your school:")
    age = st.number_input("Enter your age:", min_value=1, max_value=120)
    city = st.text_input("Enter your city:")
    medical_history = st.text_area("Enter any medical history:")
    gender = st.radio("Select your gender:", ("Male", "Female"))

    # Checkbox for specializations
    allopathy = st.checkbox("Allopathy")
    homeopathy = st.checkbox("Homeopathy")
    ayurveda = st.checkbox("Ayurveda")

    # Save user input into session state (optional)
    st.session_state.student_name = student_name
    st.session_state.school = school
    st.session_state.age = age
    st.session_state.city = city
    st.session_state.medical_history = medical_history
    st.session_state.gender = gender

    # Search button functionality
    if st.button("Search"):
        if city:
            # Load the data
            df = pd.read_csv('doctorss.csv')
            
            # Filter by city, handling NaN values in 'Town' column
            filtered_df = df[df['Town'].str.contains(city, case=False, na=False)]

            # Replace NaN values in specialization columns with False
            specialization_columns = ['Allopathy', 'Homeopathy', 'Ayurveda']
            filtered_df[specialization_columns] = filtered_df[specialization_columns].fillna(False)

            # Apply further filtering based on selected specializations
            if allopathy:
                filtered_df = filtered_df[filtered_df['Allopathy']]
            if homeopathy:
                filtered_df = filtered_df[filtered_df['Homeopathy']]
            if ayurveda:
                filtered_df = filtered_df[filtered_df['Ayurveda']]

            # Display the results
            if not filtered_df.empty:
                st.write("Doctors in your town:")
                st.dataframe(filtered_df)
            else:
                st.write("No doctors found matching your criteria.")

    # Button to view doctor profile
    if st.button("View Doctor Profile"):
        st.session_state.page = "doctor_profile_page"

    if st.button("Back"):
        st.session_state.page = "current_page"

