def doc_page():
    st.title("**Doctor Registration Form**")
    with st.form(key='doctor_form'):
        st.write("Please enter your details:")

        name = st.text_input("Enter your name:")
        number = st.text_input("Enter your number:")
        town = st.text_input("Enter your city")
        age = st.number_input("Enter Your Age", min_value=1, max_value=120)
        specialisation = st.text_input("Enter Your Specialisation")
        email = st.text_input("Enter Your E-Mail")

        st.write("Select your field(s):")
        field1 = st.checkbox("Allopathy")
        field2 = st.checkbox("Homeopathy")
        field3 = st.checkbox("Ayurveda")

        submitted = st.form_submit_button("Submit")

        if submitted:
            data = {
                'Name': name,
                'Number': number,
                'Town': town,
                'Age': age,
                'E-Mail': email,
                'Specialisation': specialisation,
                'Allopathy': field1,
                'Homeopathy': field2,
                'Ayurveda': field3,
            }
            new_data_df = pd.DataFrame([data])
            df = pd.read_csv('doctorss.csv')
            df = pd.concat([df, new_data_df], ignore_index=True)
            df.to_csv('doctorss.csv', index=False)
            st.success("Doctor registration successful!")

    if st.button("Back"):
        st.session_state.page = "current_page"

def create_pdf(data):
    buffer = BytesIO()
    p = canvas.Canvas(buffer, pagesize=letter)
    p.setFont("Helvetica-Bold", 14)
    p.drawString(100, 780, "Health Report Summary")
    
    p.setFont("Helvetica", 12)
    y = 760
    for key, value in data.items():
        p.drawString(100, y, f"{key}: {value}")
        y -= 20
    
    p.save()
    buffer.seek(0)
    return buffer

