def rate_doctor_page():
    st.title("**Rate a Doctor**")
    df = pd.read_csv('doctorss.csv')
    
    # Ensure necessary columns exist
    if 'Total Ratings' not in df.columns:
        df['Total Ratings'] = 0
    if 'Average Rating' not in df.columns:
        df['Average Rating'] = 0.0
    
    doctor_name = st.selectbox("Select a Doctor to Rate:", df['Name'].unique())
    rating = st.slider("Rate the Doctor (1-5):", 1, 5)
    
    if st.button("Submit Rating"):
        # Find the selected doctor's row index
        doctor_index = df[df['Name'] == doctor_name].index[0]
        
        # Calculate the new average rating
        total_ratings = df.at[doctor_index, 'Total Ratings'] + 1
        average_rating = ((df.at[doctor_index, 'Average Rating'] * (total_ratings - 1)) + rating) / total_ratings
        
        # Update DataFrame with new ratings
        df.at[doctor_index, 'Total Ratings'] = total_ratings
        df.at[doctor_index, 'Average Rating'] = average_rating
        
        # Save updated ratings to CSV
        df.to_csv('doct.csv', index=False)
        st.success(f"Thank you for rating {doctor_name}!")
    if st.button("Back"):
        st.session_state.page = "home_page"

