def frequent_student_issues(student_df):
    st.subheader("Most Common Student Health Issues")

    # Count occurrences for each health issue
    issues = {
        "Frequent Headaches": student_df["Frequent Headaches"].sum(),
        "Blurred Visions": student_df["Blurred Visions"].sum(),
        "Fumbling Tongue": student_df["Fumbling Tongue"].sum(),
        "Sleep Deprivation": student_df["Sleep Deprivation"].sum(),
        "Addiction Problems": student_df["Addiction Problems"].sum(),
        "Conflict with Parents/Teachers": student_df["Conflict with Parents/Teachers"].sum(),
        "Unhealthy Lifestyle": student_df["Unhealthy Lifestyle"].sum(),
        "Fear of Missing Out": student_df["Fear of Missing Out"].sum(),
        "Muscle Cramps/Joint Pains": student_df["Muscle Cramps/Joint Pains"].sum(),
        "Stage Fear": student_df["Stage Fear"].sum(),
    }

    # Display issues as a bar chart
    issues_df = pd.DataFrame(list(issues.items()), columns=["Issue", "Count"]).sort_values(by="Count", ascending=False)
    st.bar_chart(issues_df.set_index("Issue"))


